				(NULL, 'subscribers',1,1,'subscribers'),
				(NULL, 'subscribers_lists',1,1,'subscribers_lists'),
				(NULL, 'octo',1,1,'octo'),
				(NULL, 'queue',1,1,'queue'),
				(NULL, 'schedule',1,1,'schedule'),
				(NULL, 'log',1,1,'log'),

				(NULL, 'statistics',1,1,'statistics'),

				(NULL, 'forms',1,1,'forms'),
				(NULL, 'forms_widget',1,1,'forms_widget'),
				(NULL, 'forms_statistics',1,1,'forms_statistics'),

				(NULL, 'api_loader',1,1,'api_loader'),
				(NULL, 'importer',1,1,'importer'),

				(NULL, 'mail',1,1,'mail');");
		}
		if(!dbNbs::exist('@__modules', 'code', 'forms')) {
			dbNbs::query("INSERT INTO `@__modules` (id, code, active, type_id, label) VALUES
				(NULL, 'forms',1,1,'forms'),
				(NULL, 'forms_widget',1,1,'forms_widget'),
				(NULL, 'forms_statistics',1,1,'forms_statistics');");
		}
		if(!dbNbs::exist('@__modules', 'code', 'api_loader')) {
			dbNbs::query("INSERT INTO `@__modules` (id, code, active, type_id, label) VALUES
				(NULL, 'api_loader',1,1,'api_loader'),
				(NULL, 'importer',1,1,'importer');");
		}
		/**
		 *  modules_type
		 */
		if(!dbNbs::exist("@__modules_type")) {
			dbDelta(dbNbs::prepareQuery("CREATE TABLE IF NOT EXISTS `@__modules_type` (
			  `id` smallint(3) NOT NULL AUTO_INCREMENT,
			  `label` varchar(32) NOT NULL,
			  PRIMARY KEY (`id`)
