				`id` INT(11) NOT NULL AUTO_INCREMENT,
				`code` varchar(32) NOT NULL,
				`label` varchar(256) NOT NULL,
				PRIMARY KEY (`id`)
			) DEFAULT CHARSET=utf8;"));
		}
		if (!dbNbs::exist("@__octo_blocks_mission")) {
			dbDelta(dbNbs::prepareQuery("CREATE TABLE IF NOT EXISTS `@__octo_blocks_mission` (
				`id` INT(11) NOT NULL AUTO_INCREMENT,
