		/**
		 * Countries
		 */
		if (!dbNbs::exist("@__countries")) {
			  dbDelta(dbNbs::prepareQuery("CREATE TABLE `@__countries` (
				`id` int(11) NOT NULL AUTO_INCREMENT,
				`name` varchar(128) NOT NULL,
				`iso_code_2` varchar(2) DEFAULT NULL,
				`iso_code_3` varchar(3) DEFAULT NULL,
				PRIMARY KEY (`id`)
			  ) DEFAULT CHARSET=utf8;"));
			  self::_insertCountries();
		}
		/**
		* Plugin usage statistics
		*/
		if(!dbNbs::exist("@__usage_stat")) {
			dbDelta(dbNbs::prepareQuery("CREATE TABLE `@__usage_stat` (
			  `id` INT(11) NOT NULL AUTO_INCREMENT,
			  `code` varchar(64) NOT NULL,
			  `visits` INT(11) NOT NULL DEFAULT '0',
			  `spent_time` INT(11) NOT NULL DEFAULT '0',
			  `modify_timestamp` TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
			  UNIQUE INDEX `code` (`code`),
			  PRIMARY KEY (`id`)
			) DEFAULT CHARSET=utf8"));
			dbNbs::query("INSERT INTO `@__usage_stat` (code, visits) VALUES ('installed', 1)");
		}
		/**
		 * Queue table
		 */
		if (!dbNbs::exist("@__queue")) {
			dbDelta(dbNbs::prepareQuery("CREATE TABLE IF NOT EXISTS `@__queue` (
				`sid` INT(11) NOT NULL DEFAULT '0',
				`nid` INT(11) NOT NULL DEFAULT '0',
				`date_send` TIMESTAMP NOT NULL DEFAULT '0000-00-00 00:00:00',
				`date_created` TIMESTAMP NOT NULL DEFAULT CURRENT_TIMESTAMP,
				PRIMARY KEY (`sid`, `nid`)
			) DEFAULT CHARSET=utf8;"));
		}
		installerDbUpdaterNbs::runUpdate();
		if($current_version && !self::$_firstTimeActivated) {
			self::setUsed();
			// For users that just updated our plugin - don't need tp show step-by-step tutorial
			update_user_meta(get_current_user_id(), NBS_CODE . '-tour-hst', array('closed' => 1));
		}
		update_option($wpPrefix. NBS_DB_PREF. 'db_version', NBS_VERSION);
		add_option($wpPrefix. NBS_DB_PREF. 'db_installed', 1);
	}
	static public function setUsed() {
		update_option(NBS_DB_PREF. 'plug_was_used', 1);
	}
	static public function isUsed() {
		return true;	// No welcome page for now
		//return 0;
		return (int) get_option(NBS_DB_PREF. 'plug_was_used');
	}
	static public function delete( $full = false ) {
		self::_checkSendStat('delete');
		global $wpdb;
		$wpPrefix = $wpdb->prefix;
		$wpdb->query("DROP TABLE IF EXISTS `".$wpPrefix.NBS_DB_PREF."modules`");
		$wpdb->query("DROP TABLE IF EXISTS `".$wpPrefix.NBS_DB_PREF."modules_type`");
		$wpdb->query("DROP TABLE IF EXISTS `".$wpPrefix.NBS_DB_PREF."usage_stat`");

		$wpdb->query("DROP TABLE IF EXISTS `".$wpPrefix.NBS_DB_PREF."octo_blocks_categories`");
		$wpdb->query("DROP TABLE IF EXISTS `".$wpPrefix.NBS_DB_PREF."octo_cache`");
		$wpdb->query("DROP TABLE IF EXISTS `".$wpPrefix.NBS_DB_PREF."queue`");
		$wpdb->query("DROP TABLE IF EXISTS `".$wpPrefix.NBS_DB_PREF."statistics`");

		if($full) {
			$wpdb->query("DROP TABLE IF EXISTS `".$wpPrefix.NBS_DB_PREF."newsletters`");
			$wpdb->query("DROP TABLE IF EXISTS `".$wpPrefix.NBS_DB_PREF."newsletters_to_lists`");
			$wpdb->query("DROP TABLE IF EXISTS `".$wpPrefix.NBS_DB_PREF."octo`");
			$wpdb->query("DROP TABLE IF EXISTS `".$wpPrefix.NBS_DB_PREF."octo_blocks`");
			$wpdb->query("DROP TABLE IF EXISTS `".$wpPrefix.NBS_DB_PREF."subscribers`");
			$wpdb->query("DROP TABLE IF EXISTS `".$wpPrefix.NBS_DB_PREF."subscribers_lists`");
			$wpdb->query("DROP TABLE IF EXISTS `".$wpPrefix.NBS_DB_PREF."subscribers_to_lists`");
			$wpdb->query("DROP TABLE IF EXISTS `".$wpPrefix.NBS_DB_PREF."subscribers_to_lists_prev`");
			delete_option(NBS_CODE. '_opts_data');
		}
		delete_option($wpPrefix. NBS_DB_PREF. 'db_version');
		delete_option($wpPrefix. NBS_DB_PREF. 'db_installed');
	}
	static public function deactivate() {
		self::_checkSendStat('deactivate');
	}
	static private function _checkSendStat($statCode) {
		if(class_exists('frameNbs')
			&& frameNbs::_()->getModule('supsystic_promo')
			&& frameNbs::_()->getModule('options')
		) {
			frameNbs::_()->getModule('supsystic_promo')->getModel()->saveUsageStat( $statCode );
			frameNbs::_()->getModule('supsystic_promo')->getModel()->checkAndSend( true );
		}
	}
	static public function update() {
		global $wpdb;
		$wpPrefix = $wpdb->prefix; /* add to 0.0.3 Versiom */
		$currentVersion = get_option($wpPrefix. NBS_DB_PREF. 'db_version', 0);
		if(!$currentVersion || version_compare(NBS_VERSION, $currentVersion, '>')) {
			self::init( true );
			update_option($wpPrefix. NBS_DB_PREF. 'db_version', NBS_VERSION);
		}
	}
