'hPcBlqgO' => array('oid' => '0','cid' => '12','unique_id' => 'hPcBlqgO','label' => 'Text and Images','original_id' => '0', 'params' => 'a:6:{s:10:\"menu_items\";a:1:{s:3:\"val\";s:23:\"align|fill_color|bg_img\";}s:5:\"align\";a:1:{s:3:\"val\";s:4:\"left\";}s:14:\"fill_color_enb\";a:1:{s:3:\"val\";s:1:\"0\";}s:10:\"fill_color\";a:1:{s:3:\"val\";s:4:\"#fff\";}s:10:\"bg_img_enb\";a:1:{s:3:\"val\";s:1:\"0\";}s:6:\"bg_img\";a:1:{s:3:\"val\";s:43:\"[NBS_ASSETS_URL]img/blocks/ocean/1_back.png\";}}' ,'html' => '<table style=\"text-align: center; margin: 0px; padding: 0px; background-color: #fff;\" class=\"nbsMainTbl\" align=\"center\" bgcolor=\"#ffffff\" border=\"0\" cellpadding=\"0\" cellspacing=\"0\" width=\"100%\">\r\n    <tbody><tr>\r\n        <td colspan=\"3\" height=\"40\" width=\"100%\"></td>\r\n    </tr>\r\n\r\n    <tr>\r\n        <td><table width=\"10\"><tbody><tr><td></td></tr></tbody></table></td>\r\n\r\n        <td><table class=\"nbsContTbl\" width=\"100%\">\r\n            <tbody>\r\n\r\n            <tr>\r\n                <td style=\"padding-top: 10px;\" class=\"nbsEl\" data-el=\"txt\">\r\n					<p>Drag-and-drop newsletter template builder delights. Build-in mass mail sending and integration with mail services like MailChimp, Aweber, etc. Unlimited subscribers and mails for free.</p><p>= Newsletter by Supsystic Features: =</p><p><img style=\"float: right; margin-left: 5px;\" title=\"intime-bg\" src=\"[NBS_ASSETS_URL]img/blocks/text-and-images/intime-bg.jpg\" alt=\"\" data-mce-src=\"[NBS_ASSETS_URL]img/blocks/text-and-images/intime-bg.jpg\" data-mce-style=\"float: right; margin-left: 5px;\" width=\"543\" height=\"339\">* Drag-and-Drop Newsletter Template Builder</p><p>* Pre-set mobile ready email templates</p><p>* Unlimited mass mail sending and subscribers</p><p>* Newsletter subscriber statistics and mail tracking</p><p>* Email Subscription Form (integration with Popup by Supsystic)</p><p>= Drag-and-Drop Newsletter Template Builder =</p><p><img style=\"float: left; margin-right: 5px;\" title=\"block-builder-of-newsletter-plugin\" src=\"[NBS_ASSETS_URL]img/blocks/text-and-images/block-builder-of-newsletter-plugin.png\" alt=\"\" data-mce-src=\"[NBS_ASSETS_URL]img/blocks/text-and-images/block-builder-of-newsletter-plugin.png\" data-mce-style=\"float: left; margin-right: 5px;\" width=\"90\" height=\"87\">It was never so easy to edit Mailing templates! As the name displays just Drag the block and Drop it to the place you need - here it is! The simplest and most intuitive builder! Thus you can focus on creation and realizing your template design, without wondering what to do next or how to do this or that.</p><p>Now it became more functional than others! We implemented ability to add blocks with dynamic content. Ergo, when you add, for example, a new title to your blog, itÃƒÂ¢Ã¢â€šÂ¬Ã¢â€žÂ¢s annotation appears in the appropriate template block automatically and you donÃƒÂ¢Ã¢â€šÂ¬Ã¢â€žÂ¢t need to do it manually.</p><p>Surely, every needed information about drag and Drop Template builder you can find in our (http://supsystic.com/drag-drop-builder-newsletter-plugin/)</p><p>= Unlimited mass mail sending and subscribers =</p><p><img style=\"float: left; margin-right: 5px;\" title=\"block-settings-of-newsletter-template-by-supsystic\" src=\"[NBS_ASSETS_URL]img/blocks/text-and-images/block-settings-of-newsletter-template-by-supsystic.png\" alt=\"\" data-mce-src=\"[NBS_ASSETS_URL]img/blocks/text-and-images/block-settings-of-newsletter-template-by-supsystic.png\" data-mce-style=\"float: left; margin-right: 5px;\" width=\"170\" height=\"75\">Hate limits every where: in time, in quantity, in high quality? We wonÃƒÂ¢Ã¢â€šÂ¬Ã¢â€žÂ¢t stop you! Run Newsletter by Supsystic and feel free! Our Newsletter allows you to to send as many letters as you wish! Surely, for such powerful mailing you wish to do, you need to unlimit the quantity of subscribers and we forecasted in too!</p><p>Now you have strong ability to manufacture energetic newsletter mailing of infinite letters to endless subscribers all around the world!</p><p>= Newsletter subscriber statistics and mail tracking =</p><p>When all of your letters are sent, the most important is to see how many of them arrived to subscribers mails, was unique opened or reopened and how many subscribers followed the link you send. So you can provide analysis and change your Newsletter accordingly to subscribers expectations in order to grow your success.</p><p>= Email Subscription Form (integration with Popup by Supsystic) =</p><p>After uploading Newsletter by Supsystic, all of your subscribers are automatically appear in the subscribers division. But even that quantity of subscribers may not look enough for powerful Newsletter mailing. ThatÃƒÂ¢Ã¢â€šÂ¬Ã¢â€žÂ¢s why we released a new version of Newsletter plugin that contains Subscribe forms. Thus you can gather new Subscribers mails to the concrete subscription list of the Newsletter Plugin automatically! Just copy the shortcode of the Subscribe Form to the needed post or page and get new Subscribers!</p>\r\n				</td>\r\n			</tr>\r\n\r\n        </tbody></table></td>\r\n\r\n        <td><table width=\"10\"><tbody><tr><td></td></tr></tbody></table></td>\r\n    </tr>\r\n\r\n    <tr><td colspan=\"3\" height=\"40\" width=\"100%\"></td></tr>\r\n</tbody></table>\r\n','css' => '','img' => 'text-and-images.jpg','sort_order' => '0','is_base' => '1','is_pro' => '0','date_created' => '2016-11-14 23:19:34'),
